import React from "react";
import { Link } from "react-router-dom";
const Listmov = ({ props }) => {
    if(!props){
        return(
            <h1>NO SE ENCONTRARON RESULTADOS</h1>
        )
    }

  return (
    <div className="card ">
      {props.map((movies, i) => {
        return (
          <div key={i}>
            <Link to={`/movies/${movies.imdbID}`}>
              <img src={movies.Poster} alt={movies.Title} />
            </Link>
          </div>
        );
      })}
    </div>
  );
};

export default Listmov;
